CREATE FUNCTION water_infrastructure.get_active_model(p_model_type character varying) RETURNS TABLE(model_id uuid, version character varying, metrics jsonb, model_path character varying)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        m.model_id,
        m.version,
        m.metrics,
        m.model_path
    FROM water_infrastructure.ml_models m
    WHERE m.model_type = p_model_type
    AND m.is_active = TRUE
    AND m.status = 'active'
    LIMIT 1;
END;
$$;


