--
-- TOC entry 633 (class 1255 OID 24734)
-- Name: get_node_status(character varying); Type: FUNCTION; Schema: water_infrastructure; Owner: -
--

CREATE FUNCTION water_infrastructure.get_node_status(p_node_id character varying) RETURNS TABLE(node_id character varying, node_name character varying, last_reading timestamp with time zone, is_online boolean, current_flow numeric, current_pressure numeric, anomaly_count bigint)
    LANGUAGE plpgsql
    AS $$
BEGIN
    RETURN QUERY
    SELECT 
        n.node_id,
        n.node_name,
        MAX(sr.timestamp) as last_reading,
        (MAX(sr.timestamp) > CURRENT_TIMESTAMP - INTERVAL '30 minutes') as is_online,
        COALESCE((
            SELECT flow_rate 
            FROM water_infrastructure.sensor_readings 
            WHERE node_id = n.node_id 
            ORDER BY timestamp DESC 
            LIMIT 1
        ), 0) as current_flow,
        COALESCE((
            SELECT pressure 
            FROM water_infrastructure.sensor_readings 
            WHERE node_id = n.node_id 
            ORDER BY timestamp DESC 
            LIMIT 1
        ), 0) as current_pressure,
        (SELECT COUNT(*) 
         FROM water_infrastructure.anomalies 
         WHERE node_id = n.node_id 
         AND timestamp > CURRENT_TIMESTAMP - INTERVAL '24 hours'
         AND resolved_at IS NULL) as anomaly_count
    FROM water_infrastructure.nodes n
    LEFT JOIN water_infrastructure.sensor_readings sr ON n.node_id = sr.node_id
    WHERE n.node_id = p_node_id
    GROUP BY n.node_id, n.node_name;
END;
$$;


